    Right to Life/Oregon PAC received in the Oct. 15 Quarterly Report were over $200
    per iidiv & none accumulated to over $200 for the calendar year.  Memo text for
    wages belongs to 7/10/08 check to Oregon Right to Life for $324.33.  Memo text
    for telephone belongs to 7/10/08 check for $105.63 to Lois Anderson.  Memo text
    for registration for seminar belongs to 7/14/08 check for $25 to Michelle Knopp.
    \ 7/31/08 memos for wages, payroll taxes and employee benefits belong to  check
    to Oregon Right to Life for $10,756.74.  7/31/08 memo item for $250 for mileage
    reimbursement belongs to check to Oregon Right to Life for $250.  7/31/08 item
    for $270.83 does not contain express advocacy.  08/07/08 memo to AT&T Mobility
    for $77.84 belongs to 08/11/08 check for $77.84 to Lois Anderson.  All 8/29/08
    memo items belong to check # 376 to Oregon Right to Life for wages, payroll taxes
    and employee benefits.  8/29/08 check for $270.83 to Oregon Right to Life does
    not contain express advocacy.  Memo item for $49.96 to AT&T Mobility on 09/08/08
    belongs to 9/11/08 check to Lois Anderson for pnone..  Checks written on 7/24/08
    for $8,200 and 9/22/08 for $12,460 to Gateway Comm. for voter id phone surveys
    did not contain express advocacy."
